const Navbar = (props) => {
    const getUserName = name => {
        return `${name.fname} ${name.lname}`;
    }
    return (
        <section className="navbar">
            <h1>Progress Tracker</h1>
            <h2>{getUserName(props.name)}</h2>
        </section>
    )
};

export default Navbar;
